import React from 'react'
import styled from 'styled-components'
import { PDFDocument } from 'pdf-lib'

const ResumeCon = styled.div`
  margin-top: 25px;
  width: 86.1%;
  font-family: serif;
  font-size: 1.3em;
  position: absolute;
  top: 2175px;
  z-index: 5;
  background-color: rgba(0, 0, 0, 0.8);
  color: gold;
  right: 0;
  display: flex;
  flex-flow: column;
  justify-content: center;
  padding-bottom: 65px;
  align-items: center;
  h2 {
    text-align: center;
    font-size: 2em;
    margin: 40px auto;
  }
  button {
    padding: 10px;
    cursor: pointer;
    color: black;
    background-color: gold;
    font-size: 1.5em;
    border-radius: 10px;
    border: none;
    font-family: Times Roman;
    &:hover {
      background-color: rgb(2300, 180, 0);
    }
  }

  @media (max-width: 640px) {
    width: 100%;
    top: 4090px;
    padding-bottom: 70px;
    margin-top: 10px;
  }
  @media (min-width: 592px) and (max-width: 640px) {
    top: 3100px;
  }
`

const downloadPdf = async () => {
  const url =
    'data:application/pdf;base64,' // Replace with your PDF file URL

  // Fetch the PDF file as an array buffer
  const response = await fetch(url)
  const arrayBuffer = await response.arrayBuffer()

  // Load the PDF file into a PDFDocument instance
  const pdfDoc = await PDFDocument.load(arrayBuffer)

  // Convert the PDF document to a blob
  const pdfBytes = await pdfDoc.save()

  // Create a download link
  const blob = new Blob([pdfBytes], { type: 'application/pdf' })
  const downloadUrl = URL.createObjectURL(blob)

  // Trigger the download
  const link = document.createElement('a')
  link.href = downloadUrl
  link.download = "Syed's Resume.pdf" // Replace with your desired file name
  document.body.appendChild(link)
  link.click()
  document.body.removeChild(link)
}

const Resume = () => {
  return (
    <>
      <ResumeCon id="resume">
        <h2>Resume</h2>
        <button onClick={downloadPdf}>Download</button>
      </ResumeCon>
    </>
  )
}

export default Resume
